		$pattern = $array[$index++];
		$tag = $array[$index++];
		$filename = $array[$index++];
		$color = $array[$index++];

		//  Update
		$name = ucfirst(str_replace("'", "", $name));

		$hex = substr("0000".dechex($code), -4);

		$variation = ucfirst($variation);
		$pattern = ucfirst($pattern);
		if ($variation == "NA")  {$variation = "";}
		if ($pattern == "NA")  {$pattern = "";}
		if ($variation == "None")  {$variation = "";}
		if ($pattern == "None")  {$pattern = "";}

// 		$genuine = $array[$index++];
// 		if ($genuine == "Yes")  {$variation = "";}
// 		else  {$variation = "Fake";}

		$subtitle = $variation." ".$pattern;
		if ($subtitle == " ")  {$subtitle = "";}
		else  {$subtitle = " (".trim(str_replace("'", "", $subtitle)).")";}

		$tag = strtolower(str_replace(" ", "-", $tag));

		if ($color == "NA")  {$color = "";}
		else  {$color = "_".$color;}

		$filename .= ".png";
		$newName = $hex.$color.".png";

		//  Rename
		$sourcePath = $_folder.$filename;
		$targetPath = $_folder.$newName;
		rename($sourcePath, $targetPath);

		//  SQL
		$query = "INSERT INTO animal_crossing_items SET".
			" created_at=NOW()".
			", item_name='$name$subtitle'".
			", item_type='$type'".
			", item_category='$tag'".
			", item_price='5'".
			", filename='$newName'".
			"";
		echo("\n$query;  ## $count");
	}
}
?>
